import React, { Component } from 'react';

class Worry extends Component {
    render() {
        return (
            <div>
                육아 고민을 올리면 육아 전문가에게 답변을 받을 수 있다.
                <br />
                육아 전문가란 친절한 댓글을 많이 남기고 사람들의 추천을 많이 받은 사람
            </div>
        );
    }
}

export default Worry;
